import React from "react"
import FILE1 from "../components/files/file1"

const Home = () => {
  return (
    <div>
      <table>
        {FILE1.map((item) => (
          <tr key={item.voice_id}>
            <th>{item.voice_id}</th>
            <td>{item.audioCredit.callDuration}</td>
          </tr>
        ))}
      </table>
    </div>
  )
}

export default Home
